CREATE TABLE IF NOT EXISTS Inventory1 (
  id INT PRIMARY KEY,
  product_id INT NOT NULL,
  store_id INT NOT NULL,
  item_count INT NOT NULL
);

CREATE TABLE IF NOT EXISTS Sales1 (
  id INT PRIMARY KEY,
  product_id INT NOT NULL,
  employee_id INT NOT NULL, 
  store_id INT NOT NULL, 
  price REAL NOT NULL, 
  timestamp TIMESTAMP NOT NULL
);



